  input: TEXT,SA11A1,SA11A1.39925,"On 4/20/05 we received a contribution from Timothy
    Durham in the amount of $12,500 which was deposited into our federal account.  Two
    thousand five hundred dollars was transferred to our non-federal account on 4/20/05,
    which can accept unlimited contributions from individuals.  A letter was sent
    to Timothy Durham to advise him how his check was split into our accounts and
    to offer him a chance for a refund.  According to AO 2001-17, the Commission has
    deemed it sufficient to deposit checks exceeding the federal limits into a federal
    account and then to make a transfer to the non-federal account for the portion
    that exceeds the federal limit.  Therefore, year to date aggregate totals reported
    by Timothy Durham on our report is a reflection of the federal portion of the
    donor's contributions to date."
